INSERT [dbo].[Ad] ([Id], [Title], [District], [Street], [Description], [Size], [Price], [PictureId], [UserId]) VALUES (1, N'Pesti oldalon frissen renovált lakás', N'VII', N'Kertész utca 27.', N'REMEK LAKÁS REMEK HELYEN! Eladó a Liszt Ferenc tér szomszédságában, első emeleti utcai kilátással, világos jó elrendezésű lakás! Ajánlom mindenki figyelmébe, mivel mind befektetésnek, mind otthonnak kiváló lehetőség! Az ingatlan 40nm alapterületű mely felett egy 12nm-es álló galéria (szoba) és egy 6nm tároló található! A társasházban a belső felújítások, gázvezeték, villany, lépcsőház festés stb már megvolt, a külsőt nemsokára elkezdik, mellette környező házak mind felújított szép környezetűek! A lakás külön mérő órákkal ellátott, gáz fűtés és villany fűtés is rendelkezésre áll, rezsi, közös költség csekély! Kérem ingatlanosok ne hívjanak!!!!', 39, 22, 1, 2)
INSERT [dbo].[Ad] ([Id], [Title], [District], [Street], [Description], [Size], [Price], [PictureId], [UserId]) VALUES (2, N'Dunára néző tágas lakás eladó', N'V', N'Belgrád rakpart 16.', N'Belgrád rakparti, magas emeleti, 89nm-es, 4 nm-es erkéllyel rendelkező, beköltözhető állapotú ingatlant kínálok vételre. A ház kiemelkedően jó állapotú, műszakilag és esztétikailag is fel lett újítva pár éve, így a külső és a belső homlokzat is. A házban 2 lift van. 
A lakás nagyon világos a nagy ablakoknak köszönhetően, illetve tájolásából adódóan két oldalról is kap napfényt.(reggel az udvar felől, délután az utcafront felől) Az elrendezés kiváltképpen alkalmas olyan szintű átalakításra, mely lehetővé teszi a nappali és külön konyha-étkezőn felül két külön nyíló hálószoba kialakítását.(konyha-étkező áthelyezésével a jelenleg hall-ként funkcionáló helyiségbe)
', 89, 79, 2, 2)
INSERT [dbo].[Ad] ([Id], [Title], [District], [Street], [Description], [Size], [Price], [PictureId], [UserId]) VALUES (3, N'Budai lakás sürgősen eladó', N'II', N'Bem rakpart 2.', N'Napfényes polgári lakás a Duna parton Eladó! Az eladó ingatlan igényes, szép Bem rakparti házban, a második emeleten található, ablakai a Fő utcára néznek. A lakás elosztása hibátlan, szobái és a konyha különnyílnak az előtérből. A nappali tágas, nagy ablakain keresztül a nyugati napfény késő délutánig besüt. A lakás pár éve teljes körű felújításon esett át. Az összes vezeték, burkolat, szaniter cserélve lett, gazdaságos cirkó fűtést alakítottak ki. Fürdőszobájában dupla mosdó és sarokkád kapott helyett. Ablakai két légkamrás műanyag nyílászárók. A környék infrastruktúrája kiváló, pár perc séta a Batthyányi tér, és a Széll Kálmán tér, Budai fonódó villamossal bárhova eljuthatunk a városban, és a Duna part szépségét testközelből érezhetjük. Várom hívását!', 45, 25, 3, 3)
INSERT [dbo].[Ad] ([Id], [Title], [District], [Street], [Description], [Size], [Price], [PictureId], [UserId]) VALUES (4, N'Központi lakásom SOS eladó', N'V', N'Arany János utca', N'Eladó az V. kerületben, frekventált helyen egy jó állapotú ingatlan. Közlekedés kiváló, vásárlási lehetőségek közelben. Ha felkeltette érdeklődését az ingatlan vagy hasonló lakásokat keres alacsony áron kérem hívjon bizalommal.', 25, 20, 4, 3)
